import React from 'react';
import back from './src/Images/Component 15 – 1.png'
const About=(props)=>{
    return(
<>
<div className="container-fluid">
    <div className="row">
        <div className="about">
            <img src={back}/>
        </div>
    </div>
</div>

</>
    );
};
export default About;
